package com.for_loop_Conditions;

public class Demo02_ForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int i = 1; i <= 10; i++) {
			for (int j = 1; j <= 5; j++) {
				System.out.printf("i=" + i + " J=" + j + " ");
				//break;
			}
			System.out.println();
			//break;
		}

	}

}